  "field_id" int4,
  "parent_field_id" int4,
  "show_name" varchar(255) COLLATE "pg_catalog"."default" NOT NULL DEFAULT ''::character varying,
  "if_index" int2 NOT NULL DEFAULT 0,
  "time_format" varchar(255) COLLATE "pg_catalog"."default" DEFAULT ''::character varying,
  "description" varchar(255) COLLATE "pg_catalog"."default",
