COMMENT ON COLUMN "public"."basic_template_field"."if_index" IS '是否为字段创建索引，0否， 1是';
COMMENT ON COLUMN "public"."basic_template_field"."time_format" IS '如果字段是时间类型，需要配置时间格式';
COMMENT ON COLUMN "public"."basic_template_field"."description" IS '描述';
COMMENT ON COLUMN "public"."basic_template_field"."rule_config" IS 'json格式的规则配置';
COMMENT ON COLUMN "public"."basic_template_field"."create_time" IS '创建时间';
COMMENT ON COLUMN "public"."basic_template_field"."category" IS '属性分类，0全部， 1预定义 2自定义';
COMMENT ON COLUMN "public"."basic_template_field"."if_rule" IS '是否校验规则，0否， 1是';
COMMENT ON TABLE "public"."basic_template_field" IS '数据模板包含的字段列表';

